    const response = await fetch(`${SERVER_DOMAIN}/colors`);
    return response.json();
  } catch {
    throw new Error('could not fetch the default price');
  }
};

export const getCharacters = async () => {
  try {
    const response = await fetch('https://rickandmortyapi.com/api/character');
    return response.json();
  } catch {
    throw new Error('could not fetch the default price');
  }
};

const MATEO_SERVER = 'https://api.open-meteo.com/v1/forecast?current_weather=true&latitude=-24.2107706&longitude=-65.2738462&timezone=America/Argentina/Jujuy';

